import React from "react";

import "./Header.css";

const Header = ({ username }) => {
  return (
    <>
      <div className="logo">
        <h1>A Musical Planet</h1>
      </div>
      <div className="navBar">
        <button>Home</button>
        <button>About</button>
        <button>Leaderboard</button>
        <button>{username}</button>
      </div>
    </>
  );
};

export default Header;
